import React from "react";
import { Navbar } from "rsuite";

function Header (){

    const instance = (
        <Navbar>
          <Navbar.Header>
            <a href="#" className="navbar-brand logo">RSUITE</a>
          </Navbar.Header>
          <Navbar.Body>
            <Nav pullRight>
              <Nav.Item icon={<Icon icon="cog" />} >Settings</Nav.Item>
            </Nav> 
          </Navbar.Body>}
        </Navbar>
      );

    return (
    <div>
      <h1>Header</h1>
    </div>
    )
}

export default Header;
